import React, { useState, useEffect } from 'react';
import { Lead, LeadUpdateForm } from '../types';
import { leadsAPI } from '../api';
import { toast } from 'react-toastify';
import LeadCard from './LeadCard';
import LeadUpdateModal from './LeadUpdateModal';

const QualifierDashboard: React.FC = () => {
  const [leads, setLeads] = useState<Lead[]>([]);
  const [loading, setLoading] = useState(true);
  const [updatingLead, setUpdatingLead] = useState<Lead | null>(null);
  const [updateLoading, setUpdateLoading] = useState(false);

  useEffect(() => {
    fetchLeads();
  }, []);

  const fetchLeads = async () => {
    try {
      setLoading(true);
      const response = await leadsAPI.getLeads({ status: 'sent_to_kelly' });
      setLeads(response.results);
    } catch (error) {
      console.error('Failed to fetch leads:', error);
      toast.error('Failed to fetch leads');
    } finally {
      setLoading(false);
    }
  };

  const handleUpdateLead = async (lead: Lead) => {
    setUpdatingLead(lead);
  };

  const handleLeadUpdate = async (id: number, data: LeadUpdateForm) => {
    try {
      setUpdateLoading(true);
      await leadsAPI.updateLead(id, data);

      // Update the leads list
      setLeads(prev => prev.filter(lead => lead.id !== id));

      toast.success('Lead updated successfully!');
      setUpdatingLead(null);
    } catch (error) {
      console.error('Failed to update lead:', error);
      toast.error('Failed to update lead');
    } finally {
      setUpdateLoading(false);
    }
  };

  const getStatusCounts = () => {
    const counts = {
      interested: 0,
      qualified: 0,
      appointment_set: 0,
      not_interested: 0,
    };

    leads.forEach(lead => {
      counts[lead.status]++;
    });

    return counts;
  };

  const statusCounts = getStatusCounts();

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-indigo-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-white shadow rounded-lg p-6">
        <div className="flex items-center justify-between">
          <div>
            <h2 className="text-2xl font-bold text-gray-900">Qualifier Dashboard</h2>
            <p className="text-gray-600">Review and qualify interested leads</p>
          </div>
          <button
            onClick={fetchLeads}
            className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors"
          >
            Refresh Leads
          </button>
        </div>
      </div>

      {/* Stats */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <div className="w-8 h-8 bg-green-100 rounded-full flex items-center justify-center">
                  <span className="text-green-600 text-sm font-medium">I</span>
                </div>
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Interested</dt>
                  <dd className="text-lg font-medium text-gray-900">{statusCounts.interested}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <div className="w-8 h-8 bg-blue-100 rounded-full flex items-center justify-center">
                  <span className="text-blue-600 text-sm font-medium">Q</span>
                </div>
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Qualified</dt>
                  <dd className="text-lg font-medium text-gray-900">{statusCounts.qualified}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <div className="w-8 h-8 bg-purple-100 rounded-full flex items-center justify-center">
                  <span className="text-purple-600 text-sm font-medium">A</span>
                </div>
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Appointments</dt>
                  <dd className="text-lg font-medium text-gray-900">{statusCounts.appointment_set}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <div className="w-8 h-8 bg-red-100 rounded-full flex items-center justify-center">
                  <span className="text-red-600 text-sm font-medium">N</span>
                </div>
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Not Interested</dt>
                  <dd className="text-lg font-medium text-gray-900">{statusCounts.not_interested}</dd>
                </dl>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Instructions */}
      <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
        <h3 className="text-sm font-medium text-blue-800 mb-2">Qualifier Instructions</h3>
        <ul className="text-sm text-blue-700 space-y-1">
          <li>• Review leads with "Interested" status</li>
          <li>• Update lead status to "Qualified" or "Not Interested"</li>
          <li>• Schedule appointments for qualified leads</li>
          <li>• Add notes about the qualification process</li>
        </ul>
      </div>

      {/* Leads List */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-6 py-4 border-b border-gray-200">
          <h3 className="text-lg font-medium text-gray-900">Leads to Qualify</h3>
          <p className="text-sm text-gray-600">Leads with "Interested" status</p>
        </div>
        <div className="p-6">
          {leads.length === 0 ? (
            <div className="text-center py-8">
              <p className="text-gray-500">No interested leads to qualify at the moment.</p>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
              {leads.map((lead) => (
                <LeadCard
                  key={lead.id}
                  lead={lead}
                  onUpdate={handleUpdateLead}
                  showActions={true}
                />
              ))}
            </div>
          )}
        </div>
      </div>

      {/* Update Modal */}
      {updatingLead && (
        <LeadUpdateModal
          lead={updatingLead}
          onUpdate={handleLeadUpdate}
          onClose={() => setUpdatingLead(null)}
          loading={updateLoading}
        />
      )}
    </div>
  );
};

export default QualifierDashboard;
